import React from 'react'

const FilterBox = () => {
    return(
        <div class='dropdown'>
            <button onClick='dropFunction()' class='dropDwnBtn'>Choose Game</button>    
            <div id='theDropdown' class='dropdown-content'>
                <input type='text' placeholder='Version' id='myInput' onkeyup='filterFunction()'/>
                
            </div>
        </div>
    )
}

export default FilterBox;
